--
-- Create procedure `Proc_GetEmployeeSearching`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_GetEmployeeSearching (IN EmployeeCode varchar(255), IN FullName varchar(255), IN PhoneNumber varchar(255), IN DepartmentId char(36), IN PositionId char(36))
BEGIN
  SELECT
    e.*,
    p.PositionName,
    d.DepartmentName
  FROM Employee e
    INNER JOIN Department d
      ON e.DepartmentId = d.DepartmentId
    INNER JOIN Position p
      ON e.PositionId = p.PositionId
  WHERE (e.EmployeeCode LIKE CONCAT('%', EmployeeCode, '%')
  OR e.FullName LIKE CONCAT('%', FullName, '%')
  OR e.PhoneNumber LIKE CONCAT('%', PhoneNumber, '%'))
  AND ((DepartmentId IS NOT NULL
  AND e.DepartmentId = DepartmentId)
  OR DepartmentId IS NULL)
  AND ((PositionId IS NOT NULL
  AND e.PositionId = PositionId)
  OR PositionId IS NULL);
END
$$

